import React from 'react'

const Header = () => {
  return (
    <div>
        <header>
            <nav className='navbar navbar-expend-md navbar-dark bg-dark'>
                <a className='navbar-brand'>Student Management Application</a>
            </nav>
        </header>
    </div>
  )
}

export default Header
